INSERT INTO `he_contract_template` VALUES (2, '员工竞业限制和保密协议', 'https://he-contract.oss-cn-guangzhou.aliyuncs.com/2021/11/21/1d0ba309029f481bbf73fb61b9ff13d5.docx', '鉴于乙方在甲方任职期间，接触、知悉甲方的若干商业秘密；鉴于乙方即将同甲方终止或解除劳动关系（包括但不仅限于劳动合同到期、离退休、调动、辞职、辞退、自动离职、除名等，以下简称离职），为保护双方的合法权益，明确双方各自的权利义务，现就乙方离职以后有关保密及竞业限制等事项，双方签订如下协议，以共同信守：', '劳动人事', b'0', '2021-10-25 15:39:56', '2021-11-21 17:06:11');
INSERT INTO `he_contract_template` VALUES (3, '技术服务合同', 'https://he-contract.oss-cn-guangzhou.aliyuncs.com/2021/11/21/1e2c17aa284543358c03a1e99bdfa32d.doc', '乙方开发、生产相应的软件产品，并拥有该等软件产品的计算机软件著作权；\n	甲方希望获得乙方开发、生产的软件的使用许可，乙方同意授予甲方该等软件的使用许可。', '知识产权', b'0', '2021-10-30 16:04:43', '2021-12-04 16:37:55');
